        <div className="container py-5">
                <h3 className="py-2">REACT_HOOKS</h3>
                


                <h5>{id} - { name }</h5>


                <h5>{ user }</h5>

                { 
                    user.map( (res,index)=> <li key="index">res</li> )
                }


        </div>
    )
}


